import styled from 'styled-components';

export const SignInSignUp = styled.div`
  width: 850px;
  display: flex;
  justify-content: space-between;
  margin: 30px auto;

  @media screen and (max-width: 800px) {
    width: 90vw;
    flex-direction: column;
    align-items: center;
  }
`;
